import { ReactDependentScript } from 'react';

const Education= () => {
  return (
    <article id="education">

      <ReactDependentScript
        loadingComponent={<div></div>}
        scripts={['//cdn.credly.com/assets/utilities/embed.js']}
      >
        <div data-iframe-width="150" data-iframe-height="270" data-share-badge-id="73840c32-0df6-438d-aa6d-49b576c9b46f" data-share-badge-host="https://www.credly.com"></div>
      </ReactDependentScript>
    </article>
  )
}

export default Education
